 21:42:05'),(1477,179,2,147,'2','2020-02-02 21:42:05'),(1478,179,3,147,'2','2020-02-02 21:42:05'),(1479,179,1,147,'4','2020-02-02 21:43:02'),(1480,179,2,147,'2','2020-02-02 21:43:02'),(1481,179,3,147,'2','2020-02-02 21:43:02'),(1482,247,1,147,'7','2020-02-02 22:09:51'),(1483,247,2,147,'2','2020-02-02 22:09:51'),(1484,247,4,147,'Rodas sajūta, ka starp Tumsā gāju Re-Do un Tumsā gāju 3 trūkst starpposma. Tikko vēl bija tikai 2 akordi, bet nākamajā nodarbībā uzreiz darbošanās ar abām rokām. Lekcija sākas ar atsauci uz kaut ko iepriekš apgūtu, bet tāda video nemaz nav.\r\nLēciens no sarežģītības 5 uz sarežģīību 21 ir pārāk liels. Kaut cik sapratu tikai tādēļ, ka ir zināmas iemaņas darboties ar abu roku pirkstiem. Iesācējam šāda sarežģītības kāpināšana ir par strauju. Piedevām, pārāk maz tiek paskaiddrots, kādi akordi, kādas stīgas, ar kuriem pirkstiem jādarbojas. Ja nav ne nošu, ne izsmeļošāka skaidrojuma, ne pakāpeniskas pirkstu tehnikas apgūšanas uzdevums ir par sarežģītu iesācējam.','2020-02-02 22:09:51'),(1485,17,1,130,'6','2020-02-02 22:28:18'),(1486,17,2,130,'2','2020-02-02 22:28:18'),(1487,17,3,130,'2','2020-02-02 22:28:18'),(1488,17,4,130,'Paldies. Baudījis vai tikšu galā un sapratīšu. Izrādās, ka ir atbilstoši tam, ka es varu tikt līdz. Un roku uzlikt pareizi vēl jātrenē, sanāk stīvi. Neizdodas kreiso roku atbrīvot, jeb viegli uzlikt. ','2020-02-02 22:28:18'),(1489,17,1,127,'5','2020-02-02 22:31:12'),(1490,17,2,127,'2','2020-02-02 22:31:12'),(1491,17,3,127,'2','2020-02-02 22:31:12'),(1492,17,4,127,'paldies! Viegli saprotami! stāstījums labā tempā!','2020-02-02 22:31:12'),(1493,17,1,63,'5','2020-02-02 23:07:07'),(1494,17,2,63,'1','2020-02-02 23:07:07'),(1495,17,3,63,'3','2020-02-02 23:07:07'),(1496,17,4,63,'Pagaidām komentāru nav, Man ir 11 stīgu kokle un tas nozīmē, ka Re akordā ar pirkstu ie jāpietur jau pirmā stīga un tas piektais pirkstiņš ir visu laiku uz tās pirmās stīgas gan Fa un La akordos?\r\n\r\nTās stīgas grūti saredzēt, kur tie pirksti atrodas. \r\n\r\nPaldies, trenēsimies. ','2020-02-02 23:07:07'),(1497,17,1,76,'6','2020-02-03 02:58:59'),(1498,17,2,76,'3','2020-02-03 02:58:59'),(1499,17,3,76,'2','2020-02-03 02:58:59'),(1500,17,1,188,'4','2020-02-03 09:01:02'),(1501,17,2,188,'3','2020-02-03 09:01:02'),(1502,17,3,188,'2','2020-02-03 09:01:02'),(1503,17,1,187,'6','2020-02-03 09:07:37'),(1504,17,2,187,'2','2020-02-03 09:07:37'),(1505,17,3,187,'2','2020-02-03 09:07:37'),(1506,17,4,187,'Paldies!','2020-02-03 09:07:37'),(1507,174,1,188,'3','2020-02-03 09:27:08'),(1508,174,2,188,'3','2020-02-03 09:27:08'),(1509,174,3,188,'3','2020-02-03 09:27:08'),(1510,17,4,50,'Esmu spēlētāja, labs atkārtojums','2020-02-03 09:39:10'),(1511,17,1,31,'5','2020-02-03 10:37:38'),(1512,17,2,31,'2','2020-02-03 10:37:38'),(1513,17,3,31,'2','2020-02-03 10:37:38'),(1514,17,1,31,'5','2020-02-03 11:02:26'),(1515,17,2,31,'2','2020-02-03 11:02:26'),(1516,17,3,31,'2','2020-02-03 11:02:26'),(1517,17,1,192,'5','2020-02-03 11:39:42'),(1518,17,2,192,'2','2020-02-03 11:39:42'),(1519,17,3,192,'2','2020-02-03 11:39:42'),(1520,17,4,192,'Paldies, materiāls man noderīgs! :)\r\nPirms pirmās lekcijas ieteicams lekcijas materiālā parādīt- kuras notis ir uz stīgas un pieminēt, no kuras oktāvas (attiecībā pret klavieru sistēmu).  Šīs lietas noteicu pēc dzirdes, pēc tam atradu caur google materiālu par skaņošanu, kur tas ir minēts ). \r\nVēl.... iedomājos, ka cilvēkam bez mūzikālās izglītības nav izpratne- kāpēc re ir re akords un nomainot vienu pirkstu tas nav re. (Man pašai, saprotams. Nošu pierakstu ar notīm un akordiem priekš sevis izveidoju pati, lai galvā veidojas skaidra sistēma.)\r\n\r\n Vēl- Ja tiek filmēts materiāls, kur rāda visu uz gaišas kokles ar tumšām stīgām- vieglāk redzams, kur atrodas pirksti!\r\n\r\nVēlot to labāko! \r\nNo sirds!\r\nPaldies!','2020-02-03 11:39:42'),(1521,17,1,234,'2','2020-02-03 12:11:00'),(1522,17,2,234,'2','2020-02-03 12:11:00'),(1523,17,3,234,'2','2020-02-03 12:11:00'),(1524,17,4,234,'Sveiki, Ansi, Laura, Jāni Vītol un koklētāja meža komanda!!!\r\n\r\nPaldies par video. Esmu iepriecināts saņemt Jūsu kokles apmācības video.\r\n\r\nRē, Fā, Lā, Do, Sol, Sol7, Sol6 pārejas ir iesēdušās sajūtās un rokās. Lūgums atsūtīt uzdevumu kreisai rokai trenēt atsevišķu stīgu ievilkšanai.\r\n\r\nDraudzīga dalīšanās harmoniskai kvalitātei:\r\nIzjutu straukumu, kad vairākas reizes video laikā skanēja ierakstā telefona vibro režīma vibrācija. Sajūta, ka tas palīdzētu koncentrēties mācībām, ja apmācības video ieraksta laikā izslēgtu telefona vibro režīmu.\r\n\r\nSvētīgu dienu!\r\n\r\nAr prieku gaidīšu nākamos video.\r\n\r\n','2020-02-03 12:11:00'),(1525,179,1,124,'2','2020-02-03 12:31:10'),(1526,179,2,124,'3','2020-02-03 12:31:10'),(1527,179,3,124,'3','2020-02-03 12:31:10'),(1528,179,4,124,'Paldies par otro nodarbību. Ļoti viegli saprotama, arī šie akordi un to pāreja krietni vieglāka nekā bija re-fa-la. Vismaz nav tik daudz jāpiedomā kurš pirksts pāriet, kurš nē. Ļoti ātri apguvu. Šis video gan šķita ļoti īss. Nesapratu vai beigas speciāli norautas jeb vienkārši nav viss video augšuplādējies. \r\nTā kā pieminējāt, ka šī dziesma arī re-la, tad nomainīju do uz la un izmēģināju arī tādu variantu. Skanēja labi. ','2020-02-03 12:31:10'),(1529,179,1,124,'2','2020-02-03 12:35:12'),(1530,179,2,124,'3','2020-02-03 12:35:12'),(1531,179,3,124,'3','2020-02-03 12:35:12'),(1532,179,4,124,'Testēju, pirmo komentāru iesniedzu. Automātiski visi lauciņi tukši. Kamēr neesmu izgājusi no leksijas lapas, varu rakstīt vēl. \r\nDrošībai pārkopēju pirmo komentāru. \r\nPaldies par otro nodarbību. Ļoti viegli saprotama, arī šie akordi un to pāreja krietni vieglāka nekā bija re-fa-la. Vismaz nav tik daudz jāpiedomā kurš pirksts pāriet, kurš nē. Ļoti ātri apguvu. Šis video gan šķita ļoti īss. Nesapratu vai beigas speciāli norautas jeb vienkārši nav viss video augšuplādējies. \r\nTā kā pieminējāt, ka šī dziesma arī re-la, tad nomainīju do uz la un izmēģināju arī tādu variantu. Skanēja labi. ','2020-02-03 12:35:12'),(1533,196,1,124,'5',