4,124,'Būtu labi, ja pateiktu kāds akords kreisajai rokai, vai kā viņu nostādīt. Varbūt pirmajā daļā tas ir minēts, bet man iesūtījās uzreiz otrā daļa, tāpēc saistīto pirmo vēl neesmu skatījusies. Šis vingrinājums ir diezgan piņķerīgs, nav tik viegls kā izskatās, bet ļoti labs treniņš kreisās rokas pirkstiem. Visgrūtāk ir trešo pirkstu pieradināt pie stīgas spēlēšanas. Un ievēroju ka ejot uz priekšu (uz īsāko stīgu) man ir grūtāk, atpakaļ ceļš nospēlējas pats, automātiski. Lēnām izspēlēt nu jau sanāk, bet būs vēl noteikti jāatkārto citreiz, lai ieiet arī tas raitais ritmiņš. Paldies par interesanto vingrinājumu.\r\nĀ, un dažreiz ja cenšos tempu paātrināt, tad kreisās rokas vietā aiziet gandrīz viss ar labo roku. Tā kā tempam vēl jāpatrennē rokas, lai iet abas secīgi. ','2020-02-20 08:49:35'),(4520,146,1,312,'2','2020-02-20 09:03:57'),(4521,146,2,312,'2','2020-02-20 09:03:57'),(4522,146,3,312,'2','2020-02-20 09:03:57'),(4523,194,1,124,'10','2020-02-20 09:06:36'),(4524,194,2,124,'1','2020-02-20 09:06:36'),(4525,194,3,124,'2','2020-02-20 09:06:36'),(4526,194,4,124,'No otrās uz sesto daļu ir par sarežģītu. Redzu ko spēlē, mēģinu darīt tāpat bet nesanāk. Es nezinu kas tur bija pirms tam, kas par spēlēšanu pa divi? Kas tas ir domāts? Es ceru ka man pievienos iztrūkstošās daļas, jo saistītajā lekcijā ir tikai pirmā daļa un tā nepalīdz saprast sesto. Tā palīdz tikai saprast otro daļu, bet ne sesto.\r\nAr šo daļu man vajag palīdzību. Kreisajai rokai sapratu kuras stīgas jāspēlē, bet kas ar to labo roku tur jādara - to īsti nespēju izburtot. Līdz ar to man nekas nesanāk. ','2020-02-20 09:06:36'),(4527,255,1,312,'2','2020-02-20 09:07:04'),(4528,255,2,312,'2','2020-02-20 09:07:04'),(4529,172,1,312,'2','2020-02-20 09:11:53'),(4530,172,2,312,'2','2020-02-20 09:11:53'),(4531,172,3,312,'2','2020-02-20 09:11:53'),(4532,248,1,312,'2','2020-02-20 09:18:36'),(4533,248,2,312,'2','2020-02-20 09:18:36'),(4534,84,1,312,'2','2020-02-20 09:24:50'),(4535,84,2,312,'2','2020-02-20 09:24:50'),(4