:32'),(9380,189,1,124,'7','2020-02-23 15:19:12'),(9381,189,2,124,'2','2020-02-23 15:19:12'),(9382,189,4,124,'Iesākumā diezgan piņķerīgi, jo gribas visu ar labo roku spēlēt. Visgrūtāk piedabūt spēlēt kreisās rokas trešo pirkstu. Kā arī ievēroju, ka ejot uz īsāko stīgu man vienmēr ir jāpiedomā kurš pirksts un kurā roka spēlē, bet ejot atpakaļ uz garāko stīgu jau tas iet raitāk, slodze itkā mazinās un pirksti aiziet automātiski. Kā arī man gribas to RE akordu visu laiku turēt mazliet atstatus no stīgām, pirksti tā kā nedaudz pacelti stāv, jo kad turu piespiestus, tad tikai ļoti lēni varu izspēlēt, bet kad turu nedaudz paceltus, tad varu arī nedaudz paātrināt tempu. ','2020-02-23 15:19:12'),(9383,17,1,17,'8','2020-02-23 15:25:09'),(9384,17,2,17,'2','2020-02-23 15:25:09'),(9385,17,3,17,'1','2020-02-23 15:25:09'),(9386,17,4,17,'Gruti','2020-02-23 15:25:09'),(9387,142,1,146,'6','2020-02-23 15:28:44'),(9388,142,2,146,'2','2020-02-23 15:28:44'),(9389,142,3,146,'2','2020-02-23 15:28:44'),(9390,139,1,124,'6','2020-02-23 15:45:35'),(9391,139,2,124,'2','2020-02-23 15:45:35'),(9392,139,4,124,'Ļoti skaista šūpuļdziesma! Paldies, noderēs!\r\nLielisks papildinājums otrais video ar skaidrojumu par Do akordu. Man gan ir par vēlu, jo Do jau vairākās dziesmās bija, taču tas ir noderīgs video, ja ar akordu saskaras pirmo reizi. Lieliska ideja! Dziesmai Seši reiti tādu par Sol akordu video varētu pielikt.\r\nDziesmas melodija diezgan viegla, ātri uztvēru. Akordus arī sapratu, pārlikt no Do uz La un atpakaļ bija diezgan viegli. Grūtības bija vairāk pie tā ritma izspēlēšanas, vienu uz leju un divus uz augšu. Tur nācās pastrādāt, kamēr labā roka iegāja ritmā, kopā ar visu melodiju. \r\nNošu materiālā atkārtojums ir arī pirmajai rindiņai. Kā arī ja ir iespēja, tad nošu materiālā ar iekavām vai kā savādāk varētu pielikt šo pirmo akordu variantu. Es pati pierakstīju ar roku, bet materiālu pilnveidošanai varētu iekļaut abus variantus. Paldies. \r\n','2020-02-23 15:45:35'),(9393,224,1,124,'7','20