an viegla. Akordus vienus pašus skaitot ritmu izspēlēt ļoti viegli. Nedaudz grūtāk bija pieliekot vārdus un melodiju. Sākumā dziedot skaitīšana juka pie tidiridi rallā, juka cik reizes akords jāspēlē, bet vairākas reizes paspēlējot to vietu atsevišķi viss izdevās. Un tad jau arī visu saliekot kopā viss ļoti viegli aizgāja. ','2020-04-18 15:03:05'),(18311,113,1,124,'5','2020-04-18 15:23:10'),(18312,113,2,124,'2','2020-04-18 15:23:10'),(18313,113,4,124,'Sākumā skatoties notis likās, ka būs ļoti sarežģīti nospēlēt beigas. Bet ar šo pirmo lēno ritmu viss ļoti labi sanāca. Nācās vērīgāk paskatīties video, lai saprastu, ka dziesmu spēlē līdz melodijas stīgai nevis vienkārši akordos. Jo video sākumā netika pateikts kā šo dziesmu spēlēs, vai kaut kas īpašs jāievēro. Pirmo reizi vienkārši klausījos un spēlēju akordus pēc notīm, bet tad sadzirdēju, ka tur nav viss akords un tad pievērsos video skatīšanai rūpīgāk, jo parasti es klausos un mēģinu darīt līdzi kā stāsta, bet šajā video maz ko stāstīja par spēlēšanas tehniku. Bet man izdevās labi un veiksmīgi tikt galā. Nedaudz patrennējos un izdevās ļoti labi. Un notīs ir sol, bet spēlējot sol7. ','2020-04-18 15:23:11'),(18314,332,1,146,'5','2020-04-18 15:36:21'),(18315,114,1,124,'3','2020-04-18 15:37:37'),(18316,114,2,124,'2','2020-04-18 15:37:37'),(18317,114,4,124,'Šajā daļā nav nekā jauna. Itkā saka ka beigās do akordā ir locījums, kur parauj kreisās rokas ceturtais pirksts vienu stīgu. Bet man jau iepriekš atsūtītajā pirmajā daļā šai dziesmai, tajā pašā vietā tiek spēlēts ceturtais pirksts. Vienīgā atšķirība ka šeit ļoti nedaudz ātrāk spēlē, bet tas temps šāds jau man izdevās pie pirmās daļas, kad biju to iemācījusies. Lekcijas sarežģītības pakāpe nav paaugstinājusies, manuprāt.. ','2020-04-18 15:37:37'),(18318,183,1,146,'4','2020-04-18 15:47:04'),(18319,183,2,146,'2','2020-04-18 15:47:04'),(18320,183,3,146,'2','2020-04-18 15:47:04'),(18321,184,1,146,'4','2020-04-18 15:53:58'),(18322,184,2,146,'2','2020-04-18 15:53:58'),(1832