inājusi). Var dot vingrinājumus, kur uzreiz ir pārleicieni, piemeram, kur tikai viena nots ir sits akords un tad pārlec atpakļa vai citu akordu. Paldies!','2020-05-16 08:08:19'),(20870,83,1,124,'3','2020-05-16 09:13:38'),(20871,83,2,124,'1','2020-05-16 09:13:38'),(20872,83,4,124,'Šī dziesma man pašai ļoti patīk, jauki ka tagad varēšu arī uz kokles izspēlēt ','2020-05-16 09:13:38'),(20873,82,1,124,'3','2020-05-16 09:27:03'),(20874,82,2,124,'1','2020-05-16 09:27:03'),(20875,82,4,124,'Šīs nianses skaisti skan, arī diezgan vienkārši izpildāmas. re akordā tas ļoti viegli iestrādātās, bet fa akordā nedaudz bija jāiespēlē, lai varētu ielikt do akordu astotdaļnotī. Lēnām spēlējot sanāca uzreiz, bet pareizā takts mērā ielikt bija nedaudz grūtāk. Bet kopumā vienkāršs uzdevums. ','2020-05-16 09:27:03'),(20876,145,1,124,'3','2020-05-16 09:40:33'),(20877,145,2,124,'1','2020-05-16 09:40:33'),(20878,145,4,124,'Paldies. Tik forša, jestra dziesmiņa, žēl ka nav pilni vārdi notīs.\r\nDziesmiņa bija viegla, video ļoti labi un skaidri izskaidrots kā jāspēlē, arī laba ievingrināšanās, kur sākumā pusi dziesmas, tad otru pusi un pēc tam abas kopā. ','2020-05-16 09:40:33'),(20879,151,1,124,'5','2020-05-16 09:59:09'),(20880,151,2,124,'1','2020-05-16 09:59:09'),(20881,151,4,124,'Melodija saprotama, akordi arī zināmi. Ritms labi uztverams. Grūtības sagādāja sol akordā ielikšana dziesmā. Tā vietā dziesmā visu laiku sabremzējās. Bet cītīgi patrennējoties sanāca jau arī bez lielas aizķeršanās. Sol vietā vēl jūtu ka iespringstu un vairāk jāpiedomā, bet ir jau labi iespēlējies. ','2020-05-16 09:59:09'),(20882,152,1,124,'7','2020-05-16 10:07:12'),(20883,152,2,124,'1','2020-05-16 10:07:12'),(20884,152,4,124,'Pats paņēmiens spēlēt akordu un paraut ar labo īkšķi vienu stīgu ir diezgan vienkārši, bet šajā dziesmā, pie tādas biežas akordu maiņas tas likās sarežģīti. Jo visu laiku mainījās brīvās stīgas un līdz ar to daudz jāskatās uz pirkstiem, lai parautu brīvo stīgu. Šis bija diezgan grūti, bet tieku galā. Vēl gan šur tur ķērās pirksti, bet tas vairāk būs jāpatrenējas. ','2020-05-16 10:07:12'),(20885,227,1,402,'6','2020-05-16 12:05:10'),(20886,227,2,402,'2','2020-05-16 12:05:10'),(20887,227,4,402,'Tieši šis līmenis ļoti labs! Paldies, par šo dziesmu! Patika treniņš ar vairākiem akordiem, sākumā bija grūti, bet tad aizgāja!\r\n\r\n','2020-05-16 12:05:10'),(20888,24,1,324,'1','2020-05-16 12:52:01'),(20889,24,2,324,'3','2020-05-16 12:52:01'),(20890,45,1,324,'4','2020-05-16 12:59:57'),(20891,45,2,324,'3','2020-05-16 12:59:57'),(20892,45,4,324,'Šim atkal prasās turpinājums ar iespēlētajiem rotājumiem pa vidu akordiem :)','2020-05-16 12:59:57'),(20893,228,1,385,'5','2020-05-16 13:00:20'),(20894,228,2,385,'3','2020-05-16 13:00:20'),(20895,228,1,385,'5','2020-05-16 13:00:30'),(20896,228,2,385,'3','2020-05-16 13:00:30'),(20897,374,1,324,'1','2020-05-16 13:11:21'),(20898,374,2,324,'2','2020-05-16 13:11:21'),(20899,374,4,324,'Kaut kā neizdodas pie uzdevuma daudzuma ieklikšķināt vidējo zvaigznīti, ieklikšķinās vienlaicīgi 1. un 2. Katrā ziņā uzdevuma garums ir  - tieši tik daudz ir labi.','2020-05-16 13:11:21'),(20900,375,1,324,'8','2020-05-16 13:18:20'),(20901,375,2,324,'2','2020-05-16 13:18:20'),(20902,375,4,324,'Šo improvizāciju varam iet tālāk uz priekšu. Īkšķis gan vēl darbojas patizli...','2020-05-16 13:18:20'),(20903,133,1,324,'8','2020-05-16 13:30:23'),(20904,133,2,324,'2','2020-05-16 13:30:23'),(20905,253,1,324,'6','2020-05-16 13:46:23'),(20906,253,2,324,'2','2020-05-16 13:46:23'),(20907,273,1,324,'6','2020-05-16 13:46:40'),(20908,273,2,324,'2','2020-05-16 13:46:40'),(20909,235,1,270,'4','2020-05-16 14:59:25'),(20910,235,2,270,'3','2020-05-16 14:59:25'),(20911,17,1,414,'3','2020-05-16 15:26:59'),(20912,17,2,414,'2','2020-05-16 15:26:59'),(20913,17,4,414,'Tā kā esmu kokli agrāk spēlējusi, šis likās ļoti vienkārši (bet pilnīgam iesācējam droši vien būtu kā reizi laikā).\r\nKopumā viegli un saprotami, bet tomēr vairāki konstruktīvi ieteikumi:\r\n1) kokles stīgas šādā skatā ir ļoti grūti redzēt. Varbūt kameras rakursu ir jāpamaina vai jāpievieno grafiskie elementi, kur ir uzzīmēts, kura stīga tiek spēlēta un kura aizklāta (nebija problēma saprast, bet būtu vieglāk tā)\r\n2) man prasītos, ka ir kaut kāds lekcijas strukturējums, kas atkārtojas un palīdz mentāli galvā ssagrupēt informāciju, piem: viss ap vienu akordu (arī, piem, vai stīgas apakšā zem pirkstiem ir/nav jāspēlē), tad otrs akords, tad 2 akordu kombinācija, tad trešais akords, dažādi akordu pārlecieni, tad paraugam un saldajam ēdienam beigās viegla dziesmiņa. Principā šobrīd lekcijā visi šie elementi arī ir, bet es tos skaidri sakārtotu un ieliktu kaut kādu pauzīti vai grafisku elementu pa vidam. Piem, ja cilvēks tikko sāk, varbūt viņš grib nostiprināt katru akordu atsevišķi un tad lekt tālāk uz akordu kombinācijām, tādā gadījumā var patīt atpakaļ. JA to ļautu funkcionalitāte, var šīs lietas arī dalīt mazākos atsevišķos video, kur var attiecīgi klikšķināt uz priekšu, kad viens ir skaidrs. Šis komentārs droši vien ir vērtīgāks augstākas sarežģītības lietām, šeit nebija īsti ar to problēma. Mazie klikšķināmie video gabaliņi, kas kopā veido vienu garāku lekciju, manuprāt, ir labā prakse, ko esmu gan Runas skolas video apmācībā redzējusi, gan ārzemju kursos. Līdzīgi ir arī Smart piano app','2020-05-16 15:26:59'),(20914,81,1,126,'7','2020-05-16 15:33:31'),(20915,81,2,126,'2','2020-05-16 15:33:31'),(20916,368,1,174,'4','2020-05-16 16:13:07'),(20917,368,2,174,'2','2020-05-16 16:13:07'),(20918,368,4,174,'Zināju gan šo dziesmu, jaunībā spēlēju uz ģitāras!','2020-05-16 16:13:07'),(20919,100,1,126,'6','2020-05-16 16:35:00'),(20920,100,2,126,'2','2020-05-16 16:35:00'),(20921,295,1,281,'6','2020-05-16 19:43:47'),(20922,295,2,281,'2','2020-05-16 19:43:47'),(20923,295,4,281,'Nācās drusku pasvīst:) un vēl ir kur augt (gribētos, lai sanāk ātrāk, bet pirksti neklausa...).','2020-05-16 19:43:47'),(20924,369,1,174,'4','2020-05-16 20:19:31'),(20925,369,2,174,'2','2020-05-16 20:19:31'),(20926,